/* eslint-disable no-unused-vars */
import React, { useContext, useEffect } from "react";
import { PokemonContext } from "../../contexts/PokemonContext";

import { REDUCERCONSTANT } from "../../Constant/constantReducer";
import {
  Container,
  ContainerTitle,
  Content,
  H1,
  Li,
  P,
  Ul,
  WrapperAbilities,
  WrapperMoves,
  WrapperTypes,
} from "./style";

const { RELEASE_POKEMON } = REDUCERCONSTANT;

const PokemonDetailPage = () => {
  const { pokemons, dispatch } = useContext(PokemonContext);

  const releasePokemon = (id) => {
    dispatch({ type: RELEASE_POKEMON, id });
  };
  return (
    <PokemonContext.Consumer>
      <Container className="container">
        <H1>Pokemon Detail</H1>
        <Content className="content">
          <WrapperAbilities className="wrapper-abilities"></WrapperAbilities>
          <WrapperMoves className="wrapper-moves"></WrapperMoves>
          <WrapperTypes className="wrapper-type"></WrapperTypes>
        </Content>
      </Container>
    </PokemonContext.Consumer>
  );
};

export default PokemonDetailPage;

